    [],nt"revision_timestamp": "2016-07-27T22:54:51.126272",nt"name": "narrative-report-upper-souris-national-wildlife-refuge-7-1-1973-6-30-1974",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Upper Souris
    National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, reptiles, and disease- is also covered. The Refuge development and
    maintenance section discusses physical developments, plantings, and vegetation control.
    Resource management is described; topics include grazing, haying, fur harvesting,
    and commercial fishing. A progress report on field investigations and applied research
    is also provided. The public relations section discusses recreational uses, Refuge
    participation, hunting, violations, and safety. Items of interest and N-R forms
    are attached.",nt"license_title": "License Not Specified",nt"extras":
